<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <title>interactive map </title>
    <link rel="preconnect" href="https://fonts.googleapis.com">
<link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
<link href="https://fonts.googleapis.com/css2?family=Roboto:ital,wght@0,100..900;1,100..900&display=swap" rel="stylesheet">
    <style>

      #mapTitle {
        width: max-content;
        padding: 10px 15px;
        margin: 0 auto;
        max-width: 250px;
      }
#ikr_toltipMove {
	position: absolute;
	display: none;
	min-width: 158px;
	max-width: 250px;
	width: 100%;
	height: auto;
	padding: 10px;
	margin: 0 auto;
	font-size: 16px;
	font-family: Arial, sans-serif;
	text-align: center;

	line-height: 22px;
	background-color: #113034;
	z-index: 55;
	pointer-events: none;
	box-shadow: rgba(0, 0, 0, 0.02) 0px 1px 3px 0px, rgba(27, 31, 35, 0.15) 0px 0px 0px 1px;
	border-radius: 6px;
	border: 6px solid #c1b09f;
}

/* Paragraph styles */
#ikr_toltipMove p {
  margin: 4px 0;
  font-size: 16px;
  color: #d3b683;
}

.controls {
      position: absolute;
      top: 17px;
      right: 2%;
      z-index: 100;
      display: flex;
	/* flex-direction: column; */
	gap: 5px;
	flex-direction: column-reverse;
    }

    .controls button {
      padding: 6px;


      cursor: pointer;
    }
  /* Responsive adjustments */
    @media (max-width: 768px) {
      #ikr_toltipMove {
        font-size: 14px;
        max-width: 200px;
        padding: 8px;
      }

      #ikr_toltipMove p {
        font-size: 13px;
        line-height: 20px;
      }

      .controls button {
        padding: 4px 4px;
        cursor: pointer;
      }

 .controls {
	bottom: 11px;
	left: auto;
	top: auto;
	right: 3%;
	display: flex;
	/* flex-direction: column; */
	gap: 5px;
	flex-direction: column-reverse;
}
    }

  @media (max-width: 480px) {
      #ikr_toltipMove {
        font-size: 13px;
        max-width: 160px;
        padding: 6px;
      }

      #ikr_toltipMove p {
        font-size: 12px;
        line-height: 18px;
      }
.controls {
	bottom: 11px;
	left: auto;
	top: auto;
	right: 3%;
	display: flex;
	/* flex-direction: column; */
	gap: 5px;
	flex-direction: column-reverse;
}
      
      .controls button {
        padding: 4px 4px;
        cursor: pointer;
      }
    }

        .ikr_svg_container{
            width: 100%;
            height: auto;
         
            margin: 0 auto;
        }
        .availableLot{
            fill:green !important;

        }
        .soldLot{
            fill:red !important;

        }
        .reservedLot{
            fill:orange !important;

        }
        
    .ikr_map5 {
      overflow: hidden;
      position: relative;
    }
    
    </style>
</head>

<body>
   <div class="ikr_svg_container">
 <div class="ikr_map5">
      <div id="controls" class="controls">
        <button id="zoom_in"><svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" viewBox="0 0 24 24"
            fill="none" stroke="currentColor" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"
            aria-hidden="true" focusable="false">
            <line x1="12" y1="5" x2="12" y2="19"></line>
            <line x1="5" y1="12" x2="19" y2="12"></line>
          </svg></button>
        <button id="zoom_out"><svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" viewBox="0 0 24 24"
            fill="none" stroke="currentColor" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"
            aria-hidden="true" focusable="false">
            <line x1="5" y1="12" x2="19" y2="12"></line>
          </svg></button>
        <button id="reset"><svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" viewBox="0 0 24 24"
            fill="none" stroke="currentColor" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"
            aria-hidden="true" focusable="false">
            <path d="M8 3H5a2 2 0 0 0-2 2v3m18 0V5a2 2 0 0 0-2-2h-3m0 18h3a2 2 0 0 0 2-2v-3M3 16v3a2 2 0 0 0 2 2h3">
            </path>
          </svg></button>
      </div>

function getAllChildNodeIds(svgElement) {
    const childNodeIds = [];

    // Iterate through all child elements of the SVG
    for (const childElement of svgElement.children) {
        // Check if the child element has an ID attribute
        if (childElement.id) {
            childNodeIds.push(childElement.id);
        }

        // Recursively process child elements
        childNodeIds.push(...getAllChildNodeIds(childElement));
    }

    return childNodeIds;
}

// ====== Utilities ======
function getClientPoint(ev) {
    if (ev.touches && ev.touches[0]) {
        return { x: ev.touches[0].clientX, y: ev.touches[0].clientY };
    }
    if (ev.changedTouches && ev.changedTouches[0]) {
        return { x: ev.changedTouches[0].clientX, y: ev.changedTouches[0].clientY };
    }
    return { x: ev.clientX, y: ev.clientY };
}

// Smart positioning inside tooltip's offsetParent
function placeSmartInContainer(el, ev, pad = 8) {
    el.style.position = "absolute";

    const parent = el.offsetParent || document.body;
    const rect = parent.getBoundingClientRect();

    const cs = getComputedStyle(parent);
    const padL = parseFloat(cs.paddingLeft) || 0;
    const padT = parseFloat(cs.paddingTop) || 0;
    const padR = parseFloat(cs.paddingRight) || 0;
    const padB = parseFloat(cs.paddingBottom) || 0;

    const prevDisp = el.style.display;
    const prevVis = el.style.visibility;
    el.style.visibility = "hidden";
    el.style.display = "block";

    const w = el.offsetWidth;
    const h = el.offsetHeight;

    const pt = getClientPoint(ev);
    const relX = pt.x - rect.left - padL;
    const relY = pt.y - rect.top - padT;

    const contentW = rect.width - padL - padR;
    const contentH = rect.height - padT - padB;

    let left = relX + pad;
    let top = relY + pad;

    if (left + w > contentW) left = relX - w - pad;
    left = Math.max(0, Math.min(left, contentW - w));

    if (top + h > contentH) top = relY - h - pad;
    top = Math.max(0, Math.min(top, contentH - h));

    el.style.left = (left + padL) + "px";
    el.style.top = (top + padT) + "px";

    el.style.visibility = prevVis || "visible";
    el.style.display = prevDisp || "block";
}

// ====== TOOLTIP RENDER ======
function renderTooltipContent(mapD) {
  // helper: treat null/undefined/"" (after trim) as empty
  const isEmpty = (v) => v == null || String(v).trim() === "";

  // Clean number and add commas; drop trailing .00 for integers
  function cleanNumber(str) {
    if (isEmpty(str)) return "";
    let num = parseFloat(String(str).replace(/[^0-9.-]+/g, "")) || 0;
    let formattedNumber = num.toLocaleString(undefined, { minimumFractionDigits: 2, maximumFractionDigits: 2 });
    if (num % 1 === 0) formattedNumber = formattedNumber.replace(/\.00$/, "");
    return formattedNumber;
  }

  let statusStyle = "font-weight: bold;";
  if (mapD.status && mapD.status.toLowerCase() === "available") {
    statusStyle = "color: #d3b683; font-weight: bold;";
  } else if (mapD.status && mapD.status.toLowerCase() === "sold") {
    statusStyle = "color: red; font-weight: bold;";
  } else if (mapD.status && mapD.status.toLowerCase() === "reserved") {
    statusStyle = "color: #FFD700; font-weight: bold;";
  }

  const sizeRow = !isEmpty(mapD.size)
    ? `<p><strong>Size:</strong> ${mapD.size}</p>`
    : "";

  const priceRow = !isEmpty(mapD.PriceUSD)
    ? `<p><strong>Price USD:</strong> <span style="font-weight:bold;">$${cleanNumber(mapD.PriceUSD)}</span></p>`
    : "";

  return `
    <div style="font-family: Arial, sans-serif; line-height: 1.4;">
      <p><strong style="text-transform: capitalize;">Lot Type:</strong> <span style="text-transform:uppercase;">${mapD.use ?? ""}</span></p>
      <p><strong>Lot Number:</strong> ${String(mapD.id || "").replace(/_/g, "")}</p>
      ${sizeRow}
      ${priceRow}
      <p><strong>Status:</strong> <span style="${statusStyle}">${(mapD.status ?? "").toString().toUpperCase()}</span></p>
    </div>
  `;
}


// ====== EVENT HANDLERS ======
function handleShow(ev, ct, mapD) {
    if (!mapD) return;

    ct.classList.remove("availableLot", "soldLot");
    if (mapD.status && mapD.status.toLowerCase() === "available") {
        ct.classList.add("availableLot");
    } else if (mapD.status && mapD.status.toLowerCase() === "sold") {
        ct.classList.add("soldLot");
    } else if (mapD.status && mapD.status.toLowerCase() === "rerserved") {
        ct.classList.add("reservedLot");
    }

    tooltipMove.innerHTML = renderTooltipContent(mapD);
    tooltipMove.style.display = "block";
    placeSmartInContainer(tooltipMove, ev, 12);
}

function handleHideOnMobile(ct) {
    if (ct) {
        setTimeout(() => {

            ct.classList.remove("availableLot", "soldLot");
        }, 500);
    }
    // tooltipMove.style.display = "none";
    // tooltipMove.innerHTML = "";
}
function handleHide(ct) {
    if (ct) {
        ct.classList.remove("availableLot", "soldLot", "reservedLot");
    }
    tooltipMove.style.display = "none";
    tooltipMove.innerHTML = "";
}

// ====== BIND LISTENERS ======
mapId.forEach((id) => {
    const el = document.querySelector(`#${id}`);
    if (!el) return;

    const mapD = mapData.find(d => d.id === id);
    if (!mapD) return;

    if (isMobile()) {
        // Mobile: show on touchstart/click, hide on touchend/outside
        el.addEventListener("touchstart", (ev) => {
            ev.preventDefault();
            handleShow(ev, el, mapD);
        }, { passive: false });

        el.addEventListener("touchend", (ev) => {
            handleHideOnMobile(el);
        });

        el.addEventListener("click", (ev) => {
            handleShow(ev, el, mapD);
        });

    } else {
        // Desktop: normal hover
        el.addEventListener("mouseenter", (ev) => handleShow(ev, el, mapD));
        el.addEventListener("mousemove", (ev) => handleShow(ev, el, mapD));
        el.addEventListener("mouseleave", () => handleHide(el));
    }
});

function ikrZoom(ikrsvg) {
      /* ---------- state ---------- */
      const ts = { scale: 1, translate: { x: 0, y: 0 }, rotate: 0 };
      let currentScale = 1;
      const STEP = 0.2;
      const MAX_SCALE = 8;
      const MIN_SCALE = 1;

      let panEnabled = false;

      /* ---------- buttons ---------- */
      const zoomInBtn = document.getElementById("zoom_in");
      const zoomOutBtn = document.getElementById("zoom_out");
      const resetBtn = document.getElementById("reset");

      ikrsvg.style.touchAction = "none";
      ikrsvg.style.cursor = "default";

      /* ---------- apply transform ---------- */
      function applyTransform() {
        const t = `translate(${ts.translate.x}px, ${ts.translate.y}px) scale(${ts.scale})`;
        ikrsvg.style.transform = t;
      }

      /* ---------- button actions ---------- */
      zoomInBtn.addEventListener("click", () => {
        currentScale = Math.min(MAX_SCALE, currentScale + STEP);
        ts.scale = currentScale;

        if (!panEnabled) {
          panEnabled = true;
          ikrsvg.style.cursor = "grab";
          initPanning();
        }

        applyTransform();
      });

      zoomOutBtn.addEventListener("click", () => {
        currentScale = Math.max(MIN_SCALE, currentScale - STEP);
        ts.scale = currentScale;
        applyTransform();
      });

      resetBtn.addEventListener("click", () => {
        currentScale = 1;
        ts.scale = 1;
        ts.translate.x = ts.translate.y = 0;
        panEnabled = false;
        ikrsvg.style.cursor = "default";
        removePanning(); // This will re-clone SVG and rebind mobile listeners
        applyTransform();
      });

      /* ---------- panning ---------- */
      let startX, startY, startTX, startTY;
      const isMobileDevice =
        /Mobi|Android|iPhone|iPad|iPod|BlackBerry|IEMobile|Opera Mini/i.test(
          navigator.userAgent
        );

      function initPanning() {
        if (isMobileDevice) {
          let panId = null;
          ikrsvg.addEventListener(
            "touchstart",
            (e) => {
              if (!panEnabled || e.touches.length !== 1) return;
              const t = e.touches[0];
              panId = t.identifier;
              startX = t.clientX;
              startY = t.clientY;
              startTX = ts.translate.x;
              startTY = ts.translate.y;
            },
            { passive: false }
          );

          ikrsvg.addEventListener(
            "touchmove",
            (e) => {
              if (!panEnabled || e.touches.length !== 1) return;
              const t = Array.from(e.touches).find(
                (tt) => tt.identifier === panId
              );
              if (!t) return;
              e.preventDefault();
              const dx = (t.clientX - startX) / ts.scale;
              const dy = (t.clientY - startY) / ts.scale;
              ts.translate.x = startTX + dx;
              ts.translate.y = startTY + dy;
              applyTransform();
            },
            { passive: false }
          );

          ikrsvg.addEventListener("touchend", () => (panId = null));
        } else {
          let panning = false;
          ikrsvg.addEventListener("mousedown", (e) => {
            if (!panEnabled || e.button !== 0) return;
            panning = true;
            ikrsvg.style.cursor = "grabbing";
            startX = e.clientX;
            startY = e.clientY;
            startTX = ts.translate.x;
            startTY = ts.translate.y;
          });

          ikrsvg.addEventListener("mousemove", (e) => {
            if (!panning) return;
            const dx = (e.clientX - startX) / ts.scale;
            const dy = (e.clientY - startY) / ts.scale;
            ts.translate.x = startTX + dx;
            ts.translate.y = startTY + dy;
            applyTransform();
          });

          const stop = () => {
            panning = false;
            if (panEnabled) ikrsvg.style.cursor = "grab";
          };
          ikrsvg.addEventListener("mouseup", stop);
          ikrsvg.addEventListener("mouseleave", stop);
        }
      }

          function removePanning() {
        // Clone and replace SVG to remove pan listeners
        const clone = ikrsvg.cloneNode(true);
        ikrsvg.parentNode.replaceChild(clone, ikrsvg);

        // Update reference
        const newSvg = document.getElementById(ikrsvg.id);
        ikrsvg = newSvg;
        ikrsvg.style.touchAction = "none";
        ikrsvg.style.cursor = "default";

        // === CRITICAL: Rebind mobile tooltip listeners ===
        if (isMobileDevice) {
          mapId.forEach((id) => {
            const el = ikrsvg.querySelector(`#${id}`);
            if (!el) return;

            const mapD = mapData.find((d) => d.id === id);
            if (!mapD) return;

            // Remove old listeners if any (just in case)
            el.replaceWith(el.cloneNode(true));
            const freshEl = ikrsvg.querySelector(`#${id}`);

            freshEl.addEventListener(
              "touchstart",
              (ev) => {
                ev.preventDefault();
                handleShow(ev, freshEl, mapD);
              },
              { passive: false }
            );

            freshEl.addEventListener("touchend", (ev) => {
              handleHideOnMobile(freshEl);
            });

            freshEl.addEventListener("click", (ev) => {
              handleShow(ev, freshEl, mapD);
            });
          });
        }else{
            mapId.forEach((id) => {
            console.log('hello')

            const mapD = mapData.find((d) => d.id === id);

             // Desktop: normal hover
        freshEl.addEventListener("mouseenter", (ev) => handleShow(ev, freshEl, mapD));
        freshEl.addEventListener("mousemove", (ev) => handleShow(ev, freshEl, mapD));
        freshEl.addEventListener("mouseleave", () => handleHide(freshEl));

        // === End of mobile rebind ===

        applyTransform();

      /* ---------- initial render ---------- */
      applyTransform();
    }
